import React from "react";
import "./Projects.css";
import { useLocation } from "react-router-dom";

function Projects(props) {
  const location = useLocation();

  return (
    <>
      <div className="project-container">
      <h1 className="project-header">Project:</h1>
      <h2 className="project-subheader">{location.state.headLine}</h2>
      <img src={location.state.img} className='project-image'/>
      <h3>Date: {location.state.date}</h3>
      <a
        href={location.state.projectLink}
        target="_blank"
        rel="noopener noreferrer"
      >
        <button className="project-btn">Open in New Window</button>
      </a>
      </div>
    </>
  );
}

export default Projects;
